import React from 'react';
import { TextField, FormControl, Input, Box } from '@mui/material';
import {} from '@emotion/styled';

const Contact = () => {
  return (
    <div className=" content bg-color " id="contact">
      <h1>Contact</h1>
      <div className="form">
        <form noValidate autoComplete="off">
          <TextField
            id="standard-full-width"
            placeholder="Name"
            fullWidth
            variant="filled"
            focused
          />
        </form>
      </div>
    </div>
  );
};

export default Contact;
